package org.pilgrim.leetcode.y2020.string.issequence;

// Given a string s and a string t, check if s is subsequence of t.
public class StringIsSubsequence {
    public boolean isSubsequence2(String s, String t) {
        if (s == null || s.isEmpty()) {
            return true;
        }
        if (t == null || t.isEmpty()) {
            return false;
        }

        if (s.charAt(0) == t.charAt(0)) {
            return isSubsequence2(s.substring(1), t.substring(1));
        } else {
            return isSubsequence2(s, t.substring(1));
        }
    }

    public boolean isSubsequence(String s, String t) {
        if (s == null || s.isEmpty()) {
            return true;
        }
        if (t == null || t.isEmpty()) {
            return false;
        }
        int sIn = 0;
        int sEnd = s.length();

        int tIn = 0;
        int tEnd = t.length();

        while (sIn < sEnd && tIn < tEnd) {
            if (s.charAt(sIn) == t.charAt(tIn++)) {
                sIn++;
            }
        }

        return sIn == sEnd;
    }

    public boolean isSubsequence3(String s, String t) {
        if (s == null || s.isEmpty()) {
            return true;
        }
        if (t == null || t.isEmpty()) {
            return false;
        }
        if(s.length() > t.length()) {
            return false;
        }
        
        int i = -1;

        for (int j = 0; j < s.length(); j++) {
            char ch = s.charAt(j);

            i = t.indexOf(ch, i + 1);
            if (i < 0) {
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        StringIsSubsequence tool = new StringIsSubsequence();
        String s = "";
        String t = "";

        int n = 1000;
        
        {
            long start = System.currentTimeMillis();
            for (int i = 0; i < n; i++) {
                tool.isSubsequence(s, t);
            }
            long end = System.currentTimeMillis();
            System.out.println("" + (end - start));
        }
        
        {
            long start = System.currentTimeMillis();
            for (int i = 0; i < n; i++) {
                tool.isSubsequence2(s, t);
            }
            long end = System.currentTimeMillis();
            System.out.println("" + (end - start));
        }
        
        {
            long start = System.currentTimeMillis();
            for (int i = 0; i < n; i++) {
                tool.isSubsequence3(s, t);
            }
            long end = System.currentTimeMillis();
            System.out.println("" + (end - start));
        }
        
        System.out.println(tool.isSubsequence(s, t));
        System.out.println(tool.isSubsequence2(s, t));
        System.out.println(tool.isSubsequence3(s, t));
    }
}